const financialGoalData = [
	{
		code: 'car',
		goal: 'Buy a Car',
		firstCheckpoint: 20000,
		secondCheckpoint: 40000,
	},
	{
		code: 'house',
		goal: 'Buy a house',
		firstCheckpoint: 30000,
		secondCheckpoint: 60000,
	},
];

export default financialGoalData;
